import React, { Component } from 'react';

class Blueberry extends Component {
    styles = {
        image: {
          width: 200,
          height: 150
        }
      };
    render() { 
        return (  
            <div>
                <img class = "img-thumbnail" src = {require("./food_photos/blueberries.jpg")} style = {this.styles.image}/>
                <h1>Blueberries</h1>
                <h5>Kcal:</h5>
                <p>85 per 1 cup (185g)</p>
                <h5>Macronutrients:</h5>
                <p>Fat: 0.5 g</p>
                <p>Carbohydrates: 21 g</p>
                <p>Protein: 1.1 g</p>
                <h5>Sugar/Sodium:</h5>
                <p>Sugars: 15 g</p>
                <p>Sodium: 1 mg</p>
                <h5>Related Diseases:</h5>
                <p>Diabetes</p>
                <h5>Restaurants:</h5>
                <p>IHOP</p>
            </div>
        );
    }
}

export default Blueberry;
